import React from "react";
import StudyCard from "../studyCard/studyCardOnline";
import styles from "./studyList.module.css";

const StudyCardList = () => {
  return (
    <div className={styles.studyCards}>
      <StudyCard
        name="영어회화 스터디"
        type="온라인"
        summary="프리토킹"
        startDay="05/10"
        current="0"
        max="4"
      />
      <StudyCard />
      <StudyCard />
      <StudyCard />
    </div>
  );
};

export default StudyCardList;
